import React,{Component} from 'react';
//style importer
import * as style__ from './style';
//component importer
//utils importer

type State = typeof initState;
const initState = {
  string: "Hello my friend" as string
}
class UsersComponent extends Component<{},State>{

    state = initState

    renderHeaderBtn = () => {
        return <React.Fragment>
                    <style__.HeaderBtn>Home</style__.HeaderBtn>
                    <style__.HeaderBtn>About us</style__.HeaderBtn>
                    <style__.HeaderBtn>Docs</style__.HeaderBtn>
                    <style__.HeaderBtn>Git</style__.HeaderBtn>
                </React.Fragment>
    }
    renderSignInForm = () => {
        return <></>
    }

    render(){
        return (
            <React.Fragment>
                {this.renderSignInForm}
            </React.Fragment>
        )
    }
}

export default UsersComponent;
